const getTranscription = (roman, lang) => {
  if (!romanizationMap[roman]) return roman;
  
  // For English or Oromiffa, always use their script
  if (lang === 'en' || lang === 'om') {
    return romanizationMap[roman][lang] || roman;
  }
  
  // For Arabic and Hebrew
  const english = romanizationMap[roman].en;
  const targetLang = romanizationMap[roman][lang];
  
  if (!targetLang) return english;
  
  // Check if this is a pure vowel (no consonants) by checking the romanization
  // Pure vowels: a, e, i, o, u, ie, oa, oe, oi, oie, oo, ou, ua, etc.
  // If it's just vowel characters and no consonants, use romanization to avoid duplicate marks
  const hasConsonant = /[bcdfghjklmnpqrstvwxyz2]/i.test(english);
  
  if (!hasConsonant) {
    // Pure vowel - use romanization for clarity
    return english;
  }
  
  // Has consonant - use target language transcription
  return targetLang;
};
